import { ProjectCarousel } from "../ProjectCarousel";
import { getData } from "./getData";
import profile from "../../assets/irlProfile-cropped.jpg";
import "./Home.scss";
export function Home() {
  const data = getData();
  return (
    <main className="Home">
      <section className="bio">
        <div className="bio-card">
          <img src={profile} alt="A photo of Aaron Rine" />
          <p>Improving myself 1% every day.</p>
        </div>
        <p>
          Websites hold a tremoundous amount of power yet many businesses and individuals have
          With experience in JavaScript, HTML5, CSS, SCSS and more I can help those dreams become a reality.
        </p>
        <p>mid w/ passion for web dev</p>
        <p>conclusion w/ ways i add value</p>
      </section>
      <ProjectCarousel projects={data.projects} />
      <section className="contact">
        <p>contact</p>
        <a href="https://github.com/aaronrine/">Github</a>
        <a href="https://www.linkedin.com/in/aaron-rine-1903b511a/">LinkedIn</a>
      </section>
    </main>
  );
}
export default Home;
